    data: |
      SELECT DISTINCT + col0 * + - col2 * - 96 + + 88 AS col1, - 24 FROM tab2 (FORMAT parquet) AS cor0;
  - name: tab2

outputs:
  - name: q2334.out
    data: |
      101656	-24
      245848	-24
      417688	-24
